import React from 'react';

const Projects: React.FC = () => {
    return (
        <section
            id="projects"
            style={{
                background: "#f9f9f9",
                borderRadius: "8px",
                boxShadow: "0 2px 8px rgba(0,0,0,0.07)",
                padding: "32px",
                margin: "24px auto",
                maxWidth: "700px",
                boxSizing: "border-box"
            }}
        >
            <h2
                style={{
                    color: "#333",
                    fontSize: "2rem",
                    marginBottom: "16px",
                    textAlign: "center"
                }}
            >
                Projects
            </h2>
            <div style={{
                background: "#e3f2fd",
                borderRadius: "10px",
                padding: "16px",
                marginBottom: "16px",
                boxShadow: "0 2px 8px rgba(0,0,0,0.04)"
            }}>
                <h3 style={{ color: "#1976d2", marginBottom: "8px", textAlign: "center" }}>Farm-Connect</h3>
                <p style={{ color: "#444", fontSize: "1rem", textAlign: "center" }}>
                    <strong>Tech Stack:</strong> ReactJS, NodeJS, ExpressJS, MongoDB, TailwindCSS, Firebase, Flask<br />
                    <a href="https://github.com/mohithnr/Farm-Connect" target="_blank" rel="noopener noreferrer" style={{ color: "#1976d2", textDecoration: "underline" }}>GitHub</a> | <a href="https://farm-connect-delta.vercel.app/" target="_blank" rel="noopener noreferrer" style={{ color: "#1976d2", textDecoration: "underline" }}>Live</a>
                </p>
                <ul style={{ margin: "12px 0 0 0", padding: 0, listStyle: "disc inside", color: "#333" }}>
                    <li>Developed an AI-driven marketplace connecting farmers and buyers with comprehensive crop and farmer profiles featuring seamless management capabilities.</li>
                    <li>Engineered machine learning models to recommend optimal crops based on soil conditions and integrated 5-day weather forecasts for strategic planning.</li>
                    <li>Created a generative AI farming assistant that delivers personalized, step-by-step cultivation guidance, enhancing farmer accessibility and decision-making.</li>
                </ul>
            </div>
            <div style={{
                background: "#e3f2fd",
                borderRadius: "10px",
                padding: "16px",
                marginBottom: "16px",
                boxShadow: "0 2px 8px rgba(0,0,0,0.04)"
            }}>
                <h3 style={{ color: "#1976d2", marginBottom: "8px", textAlign: "center" }}>Drug Inventory System</h3>
                <p style={{ color: "#444", fontSize: "1rem", textAlign: "center" }}>
                    <strong>Tech Stack:</strong> TailwindCSS, ReactJS, Node.js, Express.js, SQL, Razor-Pay<br />
                    <a href="https://github.com/mohithnr/Drug-inventory-system" target="_blank" rel="noopener noreferrer" style={{ color: "#1976d2", textDecoration: "underline" }}>GitHub</a>
                </p>
                <ul style={{ margin: "12px 0 0 0", padding: 0, listStyle: "disc inside", color: "#333" }}>
                    <li>Developed a full-stack medicine management platform with real-time inventory tracking, low-stock alerts, and expiry monitoring.</li>
                    <li>Enabled secure role-based access (RBAC) for pharmacists and users; supported seamless medicine browsing, ordering, and delivery tracking.</li>
                    <li>Integrated Razorpay for secure online payments and Generative AI for AI-driven drug suggestions based on symptoms and history.</li>
                </ul>
            </div>
            <div style={{
                background: "#e3f2fd",
                borderRadius: "10px",
                padding: "16px",
                marginBottom: "0",
                boxShadow: "0 2px 8px rgba(0,0,0,0.04)"
            }}>
                <h3 style={{ color: "#1976d2", marginBottom: "8px", textAlign: "center" }}>Medical Report Analyzer</h3>
                <p style={{ color: "#444", fontSize: "1rem", textAlign: "center" }}>
                    <strong>Tech Stack:</strong> TailwindCSS, ReactJS, Node.js, Express.js, Servam AI, OCR, PDFKit<br />
                    <a href="https://github.com/mohithnr/medical-report-analyzer" target="_blank" rel="noopener noreferrer" style={{ color: "#1976d2", textDecoration: "underline" }}>GitHub</a>
                </p>
                <ul style={{ margin: "12px 0 0 0", padding: 0, listStyle: "disc inside", color: "#333" }}>
                    <li>Developed an AI-powered platform to analyze medical reports and provide automated diagnostic summaries.</li>
                    <li>Leveraged Tesseract.js for OCR, NLP for highlighting key findings, and enabled multilingual abnormality detection with AI-generated PDF reports.</li>
                    <li>Integrated Servam AI for converting diagnostic text into voice, enhancing accessibility.</li>
                </ul>
            </div>
            {/* Responsive styling */}
            <style>
                {`
                    @media (max-width: 600px) {
                        section#projects {
                            padding: 16px !important;
                            margin: 12px auto !important;
                        }
                        section#projects h2 {
                            font-size: 1.3rem !important;
                        }
                        section#projects div {
                            padding: 10px !important;
                        }
                        section#projects h3 {
                            font-size: 1.1rem !important;
                        }
                        section#projects p, section#projects ul li {
                            font-size: 1rem !important;
                        }
                    }
                `}
            </style>
        </section>
    );
};

export default Projects;
